import React, { Component } from 'react';
import './App.css';
import {inject, observer} from 'mobx-react';
import Todo from "./component/todo.js";
import Add from "./component/add";
// import {toJS} from 'mobx';

@inject('myHouseApp')
@observer

class App extends Component {

  // constructor(props) {
  //   super(props);
  //   props.myHouseApp.listHouses();
  // }

  constructor(props) {
    super(props);
  }
  componentDidMount() {        
    this.props.myHouseApp.listHouses();
  }

  render() {
    const {myHouseApp} = this.props;
    console.log(myHouseApp)
    // const myHouses = toJS(myHouseApp.houses)
    // console.log(myHouses)

    const elements = myHouseApp.map((item, key)=> 
      <Todo key={key} item={item} />
    )

    return (

      <div className="App">
        <header className="App-header">

          <h1>My House List</h1>

          <div className="get">
          <h2>Get</h2>

          <ul>
            {elements}
          </ul>
          </div>

          <div className="post">
          <h2>Post</h2>
          <Add/>
          </div>

        </header>
      </div>
    );
  }
}

export default App;
